üèûMany talented graphic designers, young men which create computer games and advertising united to create virtual videos where we could see men in the virtual world. Usually we can see only computer characters in the video games. üéëBut in the digital PFW Spring 2021 menswear we saw vivid personalities among computer graphic reality. It was very interesting experience for designers, models and directors which create digital fashion videos. Every video was unique with thoughtful idea.
üåÑDesigners identified a new trend where human lives in a virtual world. On the one hand such a format was interesting and new for us, on the other hand virtual reality isn‚Äôt natural habitat for humans.
üåèAs for me, I think that strength and beauty of nature is more important for people, because virtual world is not our home. Our home is our planet Earth (and the rest of the universe!). 
