üèôParis digital fashion week was an interesting journey to the new virtual world, where most of the people spent their personal free time. In ordinary life each of us has become creator. Most of the people create public reputation for themselves in social networks.
üì≤These marketing communities form trends in people‚Äôs outfits, public opinions, taste preferences in food, places for future vacations and many others. Many of us follow option of these virtual personalities, which ordinary life of course differ than in their social networks.
üíªThis is one of the gradations of artificial intelligence. People follow them and with each subsequent day think less and less about their own point of view on certain issues.  Fashion houses and fashion brands have always taken advantage of this and manipulated people's taste preferences. But time has come and fashion industry has become a puppet in the big game.
